import React from 'react';
import '../../../../App.css';

const hour = (props) => {
        return (
            <div className="card hourCard displayFlex displayFlexNoWrap displayRow">
                <p>{props.hour}</p>
                <p>{props.temperature} C</p>
                <p>{props.weather}</p>
                <div>
                <p>Brzina vjetra: <span>{props.windSpeed} km/h</span></p>
                <p>Mogućnost padavina: <span>{props.chanceOfRain} %</span></p>
                <p>Vlažnost vazduha: <span>{props.humidity} %</span></p>
                </div>
            </div>

        );
}

export default hour;
